import React from 'react';
import { useState } from 'react';

const [inputValue, setInputValue] = useState("");

function inputField() {

  return (
    <div className='form'>
        <input type='text' value={inputValue} />
        <button>
            <span>Add</span>
        </button>
    </div>
  )
}

export default inputField;
